// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

// Mock Aggregator interface
interface AggregatorV3Interface {
    function latestRoundData()
        external
        view
        returns (
            uint80 roundID,
            int256 answer,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        );
}

// Mock Price Feed contract
contract MockV3Aggregator {
    int256 private _price;

    constructor(int256 initialPrice) {
        _price = initialPrice;
    }

    function latestRoundData()
        public
        view
        returns (
            uint80 roundID,
            int256 answer,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        )
    {
        return (0, _price, 0, 0, 0);
    }

    function setPrice(int256 newPrice) public {
        _price = newPrice;
    }
}

contract MusicNFT is ERC721URIStorage {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    AggregatorV3Interface internal priceFeed;

    struct Shareholder {
        address owner;
        uint256 shares; // Number of shares owned by the address
    }

    mapping(uint256 => Shareholder[]) public trackOwners; // TokenId => Shareholders array
    mapping(uint256 => uint256) public totalShares; // Track ID to total shares issued (to ensure 100%)
    mapping(uint256 => uint256) public trackPrices; // TokenId => Sale price in USD (Mock)

    constructor(address _priceFeed) ERC721("MusicNFT", "MNFT") {
        if (_priceFeed == address(0)) {
            // Initialize mock price feed if address is zero
            MockV3Aggregator mockAggregator = new MockV3Aggregator(2000); // Initial price of 2000
            priceFeed = AggregatorV3Interface(address(mockAggregator));
        } else {
            priceFeed = AggregatorV3Interface(_priceFeed);
        }
    }

    // Create and mint a new Music NFT with full ownership to the creator
    function createNFT(string memory tokenURI) public returns (uint256) {
        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();
        _mint(msg.sender, newItemId);
        _setTokenURI(newItemId, tokenURI);

        // Assign full ownership (100%) to the creator
        trackOwners[newItemId].push(Shareholder(msg.sender, 100));
        totalShares[newItemId] = 100; // Initially, 100% shares

        return newItemId;
    }

    // List NFT for sale (in USD using Mock price feed)
    function listNFTForSale(uint256 tokenId, uint256 priceInUSD) public {
        require(ownerOf(tokenId) == msg.sender, "Only the owner can list the NFT for sale");
        trackPrices[tokenId] = priceInUSD;
    }

    // Get latest price from the price feed (in USD)
    function getLatestPrice() public view returns (int) {
        (
            , // roundID
            int price,
            , // startedAt
            , // updatedAt
            // answeredInRound
        ) = priceFeed.latestRoundData();
        return price;
    }

    // Buy an NFT from sale
    function buyNFT(uint256 tokenId) public payable {
        require(trackPrices[tokenId] > 0, "NFT is not for sale");
        int latestPrice = getLatestPrice();
        uint256 priceInWei = (trackPrices[tokenId] * 1e18) / uint256(latestPrice); // Convert USD to Wei

        require(msg.value >= priceInWei, "Insufficient funds");

        address previousOwner = ownerOf(tokenId);
        _transfer(previousOwner, msg.sender, tokenId);

        // Transfer ownership
        _transferOwnershipShares(tokenId, previousOwner, msg.sender, 100);

        // Reset price after sale
        trackPrices[tokenId] = 0;

        // Transfer funds to the previous owner
        payable(previousOwner).transfer(msg.value);
    }

    // Transfer fractional shares of a track
    function transferShares(uint256 tokenId, address to, uint256 shares) public {
        require(_ownsEnoughShares(tokenId, msg.sender, shares), "Not enough shares to transfer");

        // Reduce sender's shares
        _reduceShares(tokenId, msg.sender, shares);

        // Add recipient's shares
        _addShares(tokenId, to, shares);
    }

    // Combine two tracks to form a unique one
    function combineTracks(uint256 trackId1, uint256 trackId2, string memory newTokenURI) public returns (uint256) {
        require(ownerOf(trackId1) == msg.sender && ownerOf(trackId2) == msg.sender, "You must own both tracks to combine");

        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();
        _mint(msg.sender, newItemId);
        _setTokenURI(newItemId, newTokenURI);

        // Full ownership of the new track belongs to the combiner
        trackOwners[newItemId].push(Shareholder(msg.sender, 100));
        totalShares[newItemId] = 100;

        return newItemId;
    }

    // Private functions
    function _transferOwnershipShares(uint256 tokenId, address from, address to, uint256 shares) internal {
        _reduceShares(tokenId, from, shares);
        _addShares(tokenId, to, shares);
    }

    function _reduceShares(uint256 tokenId, address owner, uint256 shares) internal {
        for (uint256 i = 0; i < trackOwners[tokenId].length; i++) {
            if (trackOwners[tokenId][i].owner == owner) {
                require(trackOwners[tokenId][i].shares >= shares, "Not enough shares");
                trackOwners[tokenId][i].shares -= shares;
                return;
            }
        }
    }

    function _addShares(uint256 tokenId, address to, uint256 shares) internal {
        bool found = false;
        for (uint256 i = 0; i < trackOwners[tokenId].length; i++) {
            if (trackOwners[tokenId][i].owner == to) {
                trackOwners[tokenId][i].shares += shares;
                found = true;
                break;
            }
        }
        if (!found) {
            trackOwners[tokenId].push(Shareholder(to, shares));
        }
    }

    function _ownsEnoughShares(uint256 tokenId, address owner, uint256 shares) internal view returns (bool) {
        for (uint256 i = 0; i < trackOwners[tokenId].length; i++) {
            if (trackOwners[tokenId][i].owner == owner) {
                return trackOwners[tokenId][i].shares >= shares;
            }
        }
        return false;
    }
}
